generated.css:
@import url('https://fonts.googleapis.com/css?family=Press+Start+2P|Roboto+Condensed');
@import url('https://unpkg.com/leaflet@1.3.1/dist/leaflet.css');
@import url('https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css');

  .modal-content {
    background-color: #2D393E !important;
  }

  #title {
    top: 70%;
    left: 3%;
    position: fixed;
    z-index: 1000;
  }

  #logo {
    top: 10%;
    left: 3%;
    position: fixed;
    z-index: 1000;
  }

  h1 {
    font-family: "Press Start 2P";
    color: #ffffff;
    text-shadow: 5px 5px 20px #000000;
    font-size: 2em;
    line-height: 1.5em;
    cursor: text;
  }

  h2 {
    font-family: "Roboto Condensed";
    color: rgb(134, 147, 151);
    text-shadow: 3px 3px 20px #000000;
    font-size: 1rem;
    line-height: 2rem;
  }

  h2 a:link,
  :visited {
    color: rgb(99, 125, 134);
  }

  h2 :hover {
    color: #ED5066 !important;
  }

  body {
    padding: 0px;
    margin: 0px;
    color: white;
    background-color: #2D393E;
  }

  .tableInfo {
    margin: 1rem;
    font-family: "Roboto Condensed";
    color: rgb(180, 180, 180);
    font-size: 12px;
    line-height: 1.5em;
    z-index: 999;
  }

  .tableImg img {
    -webkit-transition: all 0.5s;
    -webkit-filter: hue-rotate(160deg) saturate(.2);
  }

  .tableImg img:hover {
    filter: none;
    -webkit-filter: hue-rotate(0) saturate(1);
    cursor: pointer;
  }

  ::-webkit-scrollbar {
    width: 5px;
    height: 10px;
  }

  ::-webkit-scrollbar-track-piece {
    background-color: rgb(68, 68, 68);
  }

  ::-webkit-scrollbar-thumb:vertical {
    height: 30px;
    background-color: rgb(179, 179, 179);
  }

  #threeDiv {
    z-index: 100;
    font-family: "Roboto Condensed";
    color: rgb(99, 122, 131);
    text-shadow: 5px 5px 20px #000000;
  }

  #d3Div {
    z-index: 100;
  }

  svg {
    display: block;
  }

  .d3-tip {
    line-height: 1;
    padding: 6px;
    background: rgba(0, 0, 0, 0.8);
    color: #fff;
    border-radius: 4px;
    font-size: 12px;
  }

  /* leaflet design */
  .leaflet-popup-content-wrapper {
    font-family: "Roboto Condensed";
    background: #2D393E;
    color: #ED5066;
    font-size: 12px;
    line-height: 24px;
  }

  .leaflet-popup-tip {
    background: #2D393E;
  }

  #map {
    height: 100%;
  }

  .leaflet-container {
    background-color: #2D393E;
  }

  .leaflet-bar.disabled,
  .leaflet-bar button.disabled {
    opacity: 0;
    border: none;
  }
